import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import ApiCall from './ApiCall';

ReactDOM.render(
  <React.StrictMode>
    <App />
    <ApiCall />
  </React.StrictMode>,
  document.getElementById('root')
);

